SET default_tablespace = '';

SET default_table_access_method = heap;

CREATE TABLE attempt (
    attid integer NOT NULL,
    regno character varying(10) NOT NULL,
    testid integer,
    marks integer,
    shuffle character varying(65535),
    att_time timestamp(6) without time zone
);



CREATE TABLE options (
    oid integer NOT NULL,
    qid integer,
    option text,
    seq integer
);




CREATE TABLE question (
    qid integer NOT NULL,
    question text,
    answer integer,
    testid integer
);




CREATE SEQUENCE question_qid_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;




ALTER SEQUENCE question_qid_seq OWNED BY question.qid;


CREATE TABLE result (
    rid integer NOT NULL,
    testid integer NOT NULL,
    regno character varying(10),
    qid integer,
    answer integer
);



CREATE TABLE student (
    regno character varying(10) NOT NULL,
    studentname character varying(200)
);



CREATE TABLE test (
    testid integer NOT NULL,
    course character varying(200),
    total integer,
    code character varying(5),
    testdate timestamp(0) without time zone,
    duration integer,
    faculty character varying(100),
    semyr character varying(25),
    head character varying(100),
    sec character varying(25),
    unitmark double precision
);



CREATE SEQUENCE test_testid_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;




ALTER SEQUENCE test_testid_seq OWNED BY test.testid;


ALTER TABLE ONLY question ALTER COLUMN qid SET DEFAULT nextval('question_qid_seq'::regclass);


ALTER TABLE ONLY test ALTER COLUMN testid SET DEFAULT nextval('test_testid_seq'::regclass);



